INSERT INTO `products` VALUES (3,'GOYA NEO là mẫu giày chạy bộ cao cấp nhất của thương hiệu Goya cho đến thời điểm hiện tại. Với công nghệ đế giày BoomMAX giúp vận động viên tối ưu hiệu suất khi chạy bộ. Có thể chạy tốc độ pace 3 trở lên. Đây cũng là mẫu giày ứng dụng công nghệ tiên tiến nhất, phù hợp cho VĐV sử dụng trong những cuộc đua đường dài. Đôi NEO phù hợp với những người chạy lâu, luyện tập chuyên nghiệp, cự li dài, tốc độ nhanh. \n- Đế giày: được làm bằng công nghệ BoomMAX là công nghệ đệm mới nhất, có tính đàn hồi cao, tăng độ nẩy hơn 25%, tăng độ hồi phục hơn 75% so với các phiên bản cũ, siêu nhẹ. Độ dày đệm đế 5cm hỗ trợ tăng hiệu suất tối đa khi chạy bộ. Ở giữa phần đế có trang bị 1 tấm carbon chống xoắn tăng sự mượt mà khi chạy nhanh ở các cung đường cua. ',10,'2022-03-20','Giày Chạy Bộ GOYA NEO',899000,50,2,_binary '',1,'GOYA','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702874531/products/eb49gqmeypmkc4nto91k.webp'),(4,'Goya Training Plus Được sản xuất bởi công ty Goya, giày có kiểu dáng mạnh mẽ, là dòng giày thể thao được nghiên cứu dành cho việc tập luyện chạy bộ và vận động cao.\n\nĐặc điểm nổi bật giày thể thao chạy bộ chính hãng Goya Training Plus \n\n- Giày công nghệ bọt khí Eva mang lại cảm giác đàn hồi êm ái cho bàn chân mà vẫn giữ được trọng lượng nhẹ cần thiết.\n\n- Được thiết kế theo động học Meta - Rocket giúp tối ưu chạy bộ khi mang giày thể thao.\n\n- Phần trên của giày chạy bộ được làm từ chất liệu cao cấp, mềm mại, dễ dàng vệ sinh.',11,'2022-03-20','Giày Chạy Bộ Goya Plus',599000,7,5,_binary '',1,'GOYA','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702874989/products/qisbeibsxugpgildlerj.webp'),(5,'Goya Strides\" là một dòng sản phẩm mới của thương hiệu giày thể thao GOYA đến từ Việt Nam. \"Strides\" trong tiếng Anh có nghĩa là \"bước chân, tượng trưng cho sự thoải mái và linh hoạt của những bước chân vdv khi sử dụng sp trong hoạt động chạy bộ. Ngoài ra còn mang ý nghĩa bước đột phá mới từ thương hiệu Goya mang đến người tiêu dùng. \n- Đây là dòng sản phẩm cải tiến của Goya Strides 2, nâng cấp hơn cả về thiết kế màu sắc phù hợp với thị yếu, độ nảy và size đã được cải tiến. \nThông số kỹ thuật:',5,'2022-03-20','Giày Chạy Bộ GOYA Strides',799000,98,5,_binary '',1,'GOYA','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702875313/products/swehji4l3lykxptk60mq.webp'),(6,'Goya Eurus Được sản xuất bởi công ty Goya, giày có kiểu dáng mạnh mẽ, là dòng giày thể thao được nghiên cứu dành cho việc tập luyện chạy bộ và vận động cao.',3,'2022-03-20','Giày Chạy Bộ Goya Eurus',599000,98,2,_binary '',1,'GOYA','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702875496/products/foktroq65bdxknetjjcb.webp'),(7,'Zoom Fly 5 thêm lớp bọt ZoomX mới cho phần đế giữa giày tạo ra một hệ thống lớp đệm nhẹ hơn và khả năng hoàn trả lực nhanh hơn. Đế giữa chứa sự kết hợp hoàn hảo giữa bọt ZoomX có lực đẩy và một tấm sợi carbon nhúng: Cùng với nhau, chúng tạo ra cảm giác chắc chắn dưới chân giúp bạn đẩy nhanh tốc độ. Điều này biến Zoom Fly 5 thành đôi giày có hiệu suất vượt trội, điều đã được làm rất tốt trong phiên bản Zoom Fly 4, nhưng nay còn tốt hơn nữa. Nó mang lại cho bạn cảm giác hoàn trả lực tốt, chuyển tiếp mượt mà ở nhiều tốc độ khác nhau. Điều này giúp bạn chạy dễ dàng hơn, nhanh hơn và có thêm niềm vui trong những buổi chạy của mình.',15,'2022-03-20','Giày Chạy bộ Nike Zoom Fly',4800000,100,7,_binary '',1,'NIKE','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702875872/products/dshtpu4iatusofiqnswk.webp'),(8,'Nike Revolution 6 được thiết kế để mang lại sự thoải mái tối đa cho đôi chân của bạn, đồng thời cung cấp khả năng hỗ trợ và độ bám đường tuyệt vời. Với thiết kế đơn giản nhưng tinh tế, Nike Revolution 6 phù hợp với mọi phong cách, từ chạy bộ hàng ngày đến dạo phố thư thái.',4,'2022-03-20','Giày chạy bộ Nike Revolution',1460000,99,9,_binary '',1,'NIKE','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702876017/products/qw3jcdlgdvnkvvqiqfm6.jpg'),(9,'Thiết kế thoải mái và trực quan giúp bàn chân của bạn cảm thấy như được ôm gọn và bảo vệ. Đệm Zoom ở gót và mũi tạo thêm lực đẩy cho sải chân của bạn khi bạn chuyển từ gót chân sang đầu ngón chân.\nCông nghệ Flywire được tích hợp với một dải giữa bàn chân để hỗ trợ toàn diện giúp giữ chân bạn ở đúng vị trí.\nCông nghệ Nike React là một loại bọt nhẹ, bền, mang đến một chuyến đi êm ái. Mang lại cảm giác tràn đầy năng lượng ngay từ đầu.\nLưỡi gà được tách ra khỏi ngoài phù hợp với các bàn chân khác nhau. Lớp đệm bổ sung ở lưỡi gà và cổ giày giúp giữ cho bàn chân của bạn luôn cảm thấy thoải mái.\nChi tiết thiết kế phản quang giúp bạn được nhận diện dễ dàng trong lúc trời tối.\nMàu sắc xanh scream/sữa dừa/honeydew/đen với phong cách DZ4776-343 sẽ giúp bạn nổi bật trong đám đông.\nGiày chạy bộ Nike Pegasus 39 được sản xuất tại Việt Nam.',9,'2022-03-20','Giày chạy bộ Nike pegasus ',2990000,100,5,_binary '',1,'NIKE','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702876248/products/jxqh29awt57u3exqnjo5.webp'),(10,'Saucony Endorphin Speed 4 là đôi giày chạy bộ tốc độ mới ra mắt của Saucony với cải tiến về đế giữa, đế ngoài và upper. Điểm nổi bật là tấm nylon hình cánh được thiết kế lại giúp tăng lực đẩy và tạo cảm giác bứt tốc hơn. Đế ngoài dạng lưới tăng độ bám đường và chuyển tiếp mượt mà. Upper lưới thoáng khí và ôm chân tốt. Endorphin Speed 4 là lựa chọn tuyệt vời cho runner muốn chinh phục tốc độ với trải nghiệm sự tốc độ mà vẫn giữ được sự thoải mái.\n\n',17,'2022-03-20','Giày chạy bộ Saucony Endorphin Speed ',4390000,97,6,_binary '',1,'SAUCONY','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702876406/products/gnpblh8zd7sqe7nnohfw.webp'),(11,'Saucony Ride 17 được nâng cấp với bọt PWRRUN+ mềm mại, êm ái hơn, giúp hoàn trả năng lượng tốt hơn. Lớp đệm vừa phải ở mắt cá chân mang lại cảm giác thoải mái ngay từ bước đầu tiên. Ride 17 là lựa chọn lý tưởng cho những người chạy bộ hàng ngày, bao gồm cả luyện tập, chạy phục hồi và đi bộ.',13,'2022-03-20','Giày Chạy Bộ Saucony Ride',3480000,100,3,_binary '',1,'SAUCONY','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702876517/products/fnnkuaifloniy1wcenzk.webp'),(12,'Khi bạn sẵn sàng để nghiêm túc chạy bộ nghĩa là bạn đã sẵn sàng cho đôi giày adidas Supernova. Thân giày bằng vải lưới tăng cường lưu thông khí tại các vùng đổ nhiều mồ hôi nhất. Lớp đệm linh hoạt ở mũi giày cùng lớp đệm đàn hồi ở gót giày cho bạn sải bước thoải mái. Đôi giày này làm từ chất liệu tái chế, thể hiện nỗ lực nghiêm túc của chúng tôi hướng tới một môi trường trong lành hơn.- Kết cấu giống với  mẫu Adidas Astrarun khi kết hợp đế Boost ở gót và đế Bounce. Tuy nhiên với những cải tiến về vật liệu cũng như thiết kế mới, mẫu Adidas Supernova mang lại cảm giác vừa vặn, thoải mái hơn, và đẹp hơn.',20,'2022-03-20','Giày Chạy Bộ Adidas Supernova',1350000,100,4,_binary '',1,'ADIDAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702876732/products/ugps5a0bso1rxaikurtw.webp'),(13,'Làm sao để cải tiến một đôi giày hoàn trả năng lượng? Hãy tăng cường hơn nữa khả năng hoàn trả năng lượng. Đôi giày adidas Ultraboost 21 này cho cảm giác siêu thoải mái, giúp bạn nhẹ nhàng tăng cự ly và cải thiện split time. Bên cạnh đế giữa được bổ sung lượng Boost, giày còn có hệ thống Linear Energy Push tiếp thêm năng lượng cho từng bước chân. Sản phẩm này may bằng vải công nghệ Primeblue, chất liệu tái chế hiệu năng cao có sử dụng sợi Parley Ocean Plastic. 50% thân giày làm bằng vải dệt, 75% vải dệt bằng sợi Primeblue. Không sử dụng polyester nguyên sinh.',8,'2022-03-20','Giày Chạy Bộ Adidas Ultraboost',2500000,100,6,_binary '',1,'ADIDAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702876874/products/m5gvceiesswhdkhvjxhm.webp'),(14,'Phiên bản mới nhất của ASICS là đây. Hãy đồng hành cùng GEL-Nimbus 23 lướt trên những chuyến hành trình tiếp theo của bạn.\nGiày chạy bộ GEL-NIMBUS ™ 23 tiếp tục mang đến sự thoải mái tuyệt vời và khả năng hấp thụ va đập trong thời gian dài. Độ ổn định được cải thiện của nó cung cấp một bước cân bằng hơn, theo sau là các chuyển tiếp mượt mà hơn. ',9,'2022-03-20','Giày Chạy Bộ ASICS Gel Nimbus',2190000,100,3,_binary '',1,'ASICS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702877133/products/jb3kjod7kkllual8dwa0.webp'),(15,'Mục đích: Chạy bộ đường dài, chạy bộ hằng hằng ngày và tập luyện trên đường bê tông.\nĐộ dốc từ gót - mũi: 10mm\nTrọng lượng: 228gram',12,'2022-03-20','Giày Chạy ASICS GEL CUMULUS',2220000,100,0,_binary '',1,'ASICS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702877290/products/whn9klhmejzf1z0imivu.webp'),(16,' Bước vào tương lai của bóng rổ với Đôi Giày Bóng Rổ Unisex Under Armour Curry Spawn Flotro! Một kiệt tác thực sự về thiết kế và tính năng, đôi giày này được thiết kế để tăng cường hiệu suất của bạn và đưa trình độ chơi lên một tầm cao mới.',3,'2022-03-20','Giày Bóng Rổ Unisex Under Armour Curry Spawn Flotro -',4700000,99,2,_binary '',2,'UNDER ARMOUR','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702877640/products/yfl2dbiio95b2jzh9awi.webp'),(17,' Hãy trải nghiệm cảm giác vượt trội cùng đôi giày bóng rổ Flow Futr X 3 từ Under Armour. Với mặt trên linh hoạt UA IntelliKnit kết hợp cùng dây Gore tiên tiến, đôi giày này đem lại sự hỗ trợ hoàn hảo cùng khả năng cố định bàn chân. Điều đặc biệt, công nghệ UA Flow cung cấp độ bám và đệm tuyệt vời, giúp bạn tự tin thể hiện tối đa tài năng của mình trên sân.',5,'2022-03-20','Giày Bóng Rổ Unisex Under Armour Flow Futr X',2400000,99,0,_binary '',2,'UNDER ARMOUR','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/imag