Thể Thao Asics GEL-RESOLUTION ',3080000,100,3,_binary '',5,'ASICS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702904156/products/e9uyjntjgfaw9kuv88tb.jpg'),(52,'Được thiết kế để hỗ trợ phục hồi nhanh giữa các cú đánh và cú đánh mạnh mẽ. Nó tạo ra một hạ cánh ổn định và giảm tải cho cơ thể. Nhờ đó, bạn có thể tập trung nhiều năng lượng hơn để tạo ra cú swing mạnh mẽ. Có thể thực hiện các lượt rẽ nhanh hơn trong thời gian ngắn hơn để có các bước chuyển hướng mượt mà hơn. Độ bám của đế ngoài và hệ thống hỗ trợ TWISTRUS cho phép bạn đạp đất mạnh mẽ hơn. Điều này sẽ cho phép bạn sao lưu nhanh chóng và trở lại vị trí chính xác một cách trơn tru hơn.',25,'2022-03-20','Giày Tennis Thể Thao Asics COURT',4500000,99,3,_binary '',5,'ASICS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702904000/products/x3u7k0jbcgmuxfiehhdp.jpg'),(53,'?Dòng #Barricade đã trở lại để giúp bạn thống lĩnh cuộc chơi. \n?Hệ thống dây giầy trực quan tạo độ ôm chân chắc chắn bằng cách nén lưỡi gà bằng cao su neoprene xuống tương ứng với hình dáng bàn chân.\n?Hệ thống Geofit ở gót giầy lấp đầy các khoảng trống còn lại để hoàn thiện kết nối. \nBên dưới là đế giữa Bounce êm ái và phần shank bằng TPU giữa bàn chân để mỗi bước đi luôn thoải mái và ổn định. \n?Chữ #adidas nổi bật ở giữa mặt bên làm từ chất liệu RPU cứng cáp có khả năng chống mài mòn do lực miết bàn chân.',10,'2022-03-20','Giầy Tennis Adidas Barricade HQ8917',2900000,98,4,_binary '',5,'ADIDAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702902843/products/epaciswxy01oe1k9gwib.jpg'),(54,'GIÀY TENNIS SOLEMATCH BOUNCE\nĐÔI GIÀY TENNIS LÓT ĐỆM GIÚP BẠN LUÔN VỮNG CHÃI.\nNâng tầm cuộc chơi sân đấu. Đôi giày tennis adidas SoleMatch Bounce này giúp bạn luôn vững chãi nhờ khung đế giày bằng TPU bao quanh bàn chân. Phía trên đế giữa Bounce linh hoạt là thân giày bằng vải lưới nhiều lớp giúp lưu thông khí cho cảm giác thoải mái suốt trận đấu. Các vùng chống mài mòn ở mũi chân giúp bạn sẵn sàng cho tất cả.',2,'2022-03-20','Giày Tennis Adidas SoleMatch Bounce M GY7650',3200000,100,0,_binary '',5,'ADIDAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702902680/products/al85ggpy5wphasnamyhu.jpg'),(55,'Sở hữu đế Boost – bộ đệm cực mềm mại, nhạy bén nhất trước đến nay của Aidas mang lại năng lượng đáng kinh ngạc. Đem lại sự tự tin tối đa khi sử dụng.\nĐi kèm những tính năng vượt trội từ các lớp thoáng khi phía trên, form giày cực thoải mái tạo độ nhẹ nhàng và thoáng mát hơn bao giờ hết.\nĐế ngoài Adiwear mang đến độ bền tối đa cùng Adituff chống mài mòn bao quanh ngón chân và bàn chân trước để giúp bảo vệ chống lại lực cản ở chân xảy ra trong các cú giao bóng, hay chuyển động mạnh.',10,'2022-03-20','Giày Tennis Adidas Sold Court Boost ',886000,100,2,_binary '',5,'ADIDAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702902538/products/mjvdk6bbkzfpipxbufn1.jpg'),(56,'Giày Chạy Trail Kailas FUGA YAO là một trong những sản phẩm nổi bật của Kailas với thiết kế, chất liệu và công nghệ vượt trội. Đôi giày mang lại cảm giác nhẹ, tốc độ và độ bám tốt trên mọi địa hình chạy. Dưới đây là những điểm đặc biệt củaa Giày Chạy Trail Nam Kailas FUGA YAO.\n\n',4,'2023-04-01','Giày chạy địa hình Kailas FUGA YAO Trail Running',3500000,148,2,_binary '',6,'KAILAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702881267/products/n5hqmwgjwa4mcwaudl55.webp'),(57,'Nike Air Zoom Terra Kiger 8 nhẹ và vừa vặn. Đôi giày có thiết kế đơn giản, vừa đủ để bạn cảm thấy phù hợp và an toàn. Với Terra Kiger, bạn cảm nhận được sự ổn định và thăng bằng trên đường trail. Vì vậy, bạn vững chắc và nhanh nhẹn trên đường chạy. Thêm vào đó, Nike Air Zoom Terra Kiger 8 mềm mại và đàn hồi. Bạn sẽ thấy sự bật nảy trong từng bước chạy! ',8,'2023-04-01','Giày chạy địa hình Nike Air Zoom Terra Kiger 8 Trail',3000000,50,0,_binary '',6,'NIKE','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702881386/products/mtiigobdxrxljgoysare.webp'),(58,'Sự lựa chọn hoàn hảo cho những người yêu thích thể thao đường mòn. Được thiết kế để vượt qua mọi thử thách, Fuga EX 2 GTX không chỉ mang lại sự thoải mái và bảo vệ cho đôi chân của bạn mà còn đem đến hiệu suất vô song trên mọi loại địa hình. Hãy cùng khám phá tại sao Fuga EX 2 GTX là đôi giày không thể thiếu của người chơi trail!',11,'2023-04-01','Giày chạy trail  Kailas Fuga EX 2 GTX',4100000,50,0,_binary '',6,'KAILAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702881527/products/rzpbf4b7afodt6wwp6ev.webp'),(59,'Đôi giày chạy bộ này có những tính năng độc đáo và tiện ích để đáp ứng nhu cầu của người vừa muốn trải nghiệm đường địa hình, vừa muốn chạy cả đường nhựa. \n\nVới công nghệ BOA® Fit System, việc điều chỉnh giày chỉ bằng một tay trở nên dễ dàng và nhanh chóng. \n\nBề mặt giày được làm từ vải lưới kỹ thuật và TPU chịu mài mòn, tạo sự nhẹ nhàng, thoáng khí và thoải mái hơn. \n\nĐiểm nổi bật của sản phẩm là Vibram Megagrip outsole, đảm bảo độ bám tuyệt vời trên mọi mặt đất ướt và khô.\n\n Đế giày Eccevai cực kỳ nhẹ, giúp bạn tiết kiệm sức lực khi chạy. Ngoài ra, midsole lấp lánh thêm điểm nhấn cho sản phẩm.',10,'2023-04-01','Giày chạy trail Kailas Fuga EX BOA',3200000,50,0,_binary '',6,'KAILAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702881632/products/wcbxofj3xkksnopufdvu.webp'),(60,'Giày chạy bộ nữ Kailas Fuga Pro 4 Trail Running-màu đỏ\nTính năng\n● Hệ thống siết chặt hai phần Kailas AWS (Adjust Whole Sole) 3.0. Khóa đầu tiên tránh bị thương ngón chân khi xuống dốc và khóa thứ hai giúp bọc chắc hơn và ổn định hơn\n● Hệ thống giá đỡ 4 điểm của đàn ghim\n● Đế giữa sử dụng công nghệ Litebase giúp giày nhẹ hơn 30% so với thông thường. Thêm với công nghệ ECCEVAL DUAL-DENSITY giúp giảm tác động lên bàn chân, tăng cường lực đẩy cho chân, bên dưới là 1 lớp khung nên sẽ giúp chân được ổn định hơn\n● Đế ngoài Vibram Megagrip với các điểm khoá giúp chống trượt, tăng tốc, giảm tốc và ổn định',5,'2023-04-01','Giày chạy trail Kailas Fuga Pro 4',4900000,50,0,_binary '',6,'KAILAS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702881802/products/lxjakwwcayd3af35ntvf.webp'),(156,'ASICS GT-2000 là một đôi giày chắc chắn, nhẹ nhàng sinh ra để dành cho những bước chạy mượt mà.  ASICS đã cải tiến đôi GT-2000 với một diện mạo hoàn toàn tươi mới nhưng vẫn giữ được những ưu điểm mà người dùng tin tưởng. Hệ thống Dynamic DuoMax của ASICS đã tạo nên một loại đế siêu bền xuyên suốt vòng đời của đôi giày, còn hệ thống Trusstic system giúp giảm thiểu khả năng trật khớp, giúp sự chuyển dịch tư thế diễn ra nhịp nhàng hơn. Với công nghệ bền vững chắc chắn, ASICS vẫn là một đôi giày nhẹ. Đôi GT-2000 của nam chỉ nặng xấp xỉ 281g, và của nữ thì xấp xỉ 221 g, điều này giúp đôi giày linh hoạt với nhiều bài tập khác nhau. Đánh giá đôi ASICS GT-2000 , nhóm trải nghiệm đã dành những lời khen ngợi cho độ nhẹ cũng như cảm giác êm ái của giày, điều tạo nên những bước chạy đầy tự tin cho cả những người mới và những người chạy marathon. ',1,'2023-05-18','Giày chạy Asics GT-2000 10',2090000,50,0,_binary '',1,'ASICS','Vải chính: 80% len, 20% cao su','https://res.cloudinary.com/martfury/image/upload/v1702902147/products/s7excxlboyim7tmcoumh.webp');
